import Person from "./Person";

const PersonList = (props) => {
  if (!props.list) return <p>No record found</p>;
  return
  <div>
    props.list.map((person) => (
    <Person data={person} key={person.sys.id}></Person>
    ));
  </div>
};
export default PersonList;
